import React, { Component } from 'react';
import { Link } from 'react-router-dom'; 
import './App.css';

class HomePage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      homepage: null
    };
  }

  componentDidMount() {
    fetch('/home') // Adjust the endpoint URL as needed
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        this.setState({ homepage: data });
      })
      .catch(error => {
        console.error('Error fetching homepage data:', error);
      });
  }

  render() {
    return (
      <div className="homepage">
        <div className="homepage-text">{pagesData.pages[0].title}</div>
        <div className="text-below">{pagesData.pages[0].text}</div>
        <Link to="/Service">
        <button type="button" className="button">
            {pagesData.pages[0].button}
          </button>
        </Link>

      </div>
    );
  }
}

export default HomePage;
